<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">

<body>
    <script>
       //Print the duplicate values in array 


       let arr=[1,2,3,2,3,1,4,5,6]
       res=[]
       dup=[]
       for(i=0;i<arr.length;i++){
        if(!res.includes(arr[i])){
            res.push(arr[i])
            
        }else{
            dup.push(arr[i])

        }
       }
       
       console.log("The duplicate values are :",dup);
       
    </script>
</body>
</html>
